利用resolve缩小搜索范围

对于外部依赖会去寻找当前的node_modules，若没找到就会向上依次寻找，可以提早配置node_modules的寻找路径，避免多次寻找。
此外，在外部依赖时需要根据package.json来分析入口，由于main, browser, module等具有不同的优先级（可查看npm文档），所以为了避免多次分析，可以指定一种入口。

