循环队列的基本实现：
class Queue() {
  constructor(capacity) {
    this.capacity = capacity;
    this.buffer = new Array(capacity)
    this.front = 0;
    this.count = 0;
  }

  enQueue(item) {
    if (!this.isFull()) {
      this.count++;
      this.buffer[(this.front + this.count - 1) % this.capacity] = item;
      return true;
    }
    return false;
  }

  deQueue(item) {
    if (!this.isEmpty()) {
      this.count--;
      this.front = (this.front + 1) % this.capacity;
      return true;
    }
    return false;
  }

  isEmpty() {
    return this.count === 0;
  }

  isFull() {
    return this.count === this.capacity;
  }
}
